import { initializeApp } from "firebase/app";
import{ getAuth } from "firebase/auth"
import { getAnalytics } from "firebase/analytics";

const firebaseConfig = {
  apiKey: "AIzaSyD2QumVCv9k1U_B8ucspUurr7hQUY8FEOo",
  authDomain: "boolean-team.firebaseapp.com",
  projectId: "boolean-team",
  storageBucket: "boolean-team.appspot.com",
  messagingSenderId: "866123845429",
  appId: "1:866123845429:web:00ca96c0d2109678b7867c",
  measurementId: "G-TD6BLGCH2V"
};

// Initialize Firebase
export const app = initializeApp(firebaseConfig);
export const auth = getAuth();

const analytics = getAnalytics(app);
